  return (
    <div>
      <Typewriter
        onInit={(typewriter) => {
          typewriter
            .typeString(
              "To unlock the door you must get code which is there in the sequence."
            )
            .callFunction(() => {
              // alert("nothing special");
              setTypeComplete(true);
            })
            .start();
        }}
      />{" "}
      <Link to="/level1">
        <button>Start</button>
      </Link>
    </div>
  );
}

